        <text id="IMPORTANT-SAFETY-INFORMATION" font-family="GTWalsheim-Bold, GT Walsheim" font-size="12" font-weight="bold" fill="#62619A">
            <tspan x="25" y="681">IMPORTANT SAFETY INFORMATION</tspan>
        </text>
        <text id="Vyvanse-is-a-federally-controlled-substance-(CII)-because-it-can-be-abused-or-lead-to-dependence.-Keep-Vyvanse-in-a-safe-place-to-prevent-misuse-and-abuse.-Selling-or-giving-away-Vyvanse-may-harm-others-and-is-against-the-law." fill="#000000" font-family="GTWalsheim-Medium, GT Walsheim" font-size="9" font-weight="400" line-spacing="11">
            <tspan x="43" y="710">Vyvanse is a federally controlled substance (CII) because it can be abused or lead to dependence. Keep Vyvanse in a safe place </tspan>
            <tspan x="43" y="721">to prevent misuse and abuse. Selling or giving away Vyvanse may harm others and is against the law. </tspan>
        </text>
        <text id="Vyvanse-is-a-stimulant-medicine.-Tell-the-doctor-if-you-or-your-child-have-ever-abused-or-been-dependent-on-alcohol,-prescription-medicines,-or-street-drugs." fill="#000000" font-family="GTWalsheim-Light, GT Walsheim" font-size="9" font-weight="300" line-spacing="11">
            <tspan x="25" y="748">Vyvanse is a stimulant medicine. Tell the doctor if you or your child have ever abused or been dependent on alcohol, prescription medicines, </tspan>
            <tspan x="25" y="759">or street drugs.</tspan>
        </text>

        <text id="Eligible-patients-will-pay-a-minimum-of-$30-and-receive-up-to-a-maximum-of-$60-off-their-co-payor-out-of-pocket-expense.-Patient-is-responsible-for-the-first-$30-and-any-prescription-costs-in-excess-of-$90.-This-offer-can-be-used-for-up-to-30-capsules-or-30-chewable-tablets-of-Vyvanse-(lisdexamfetamine-dimesylate).-Offer-is-valid-for-up-to-60-uses-through-offer-expiry.-A-valid-Prescriber-ID#-is-required-on-each-prescription.-Patient-Instructions:-In-order-to-redeem-this-offer,-you-must-have-a-valid-prescription-for-Vyvanse.-Follow-the-dosage-instructions-given-by-the-prescribing-doctor.-This-offer-may-not-be-redeemed-for-cash.-By-using-this-offer,-you-are-certifying-that-you-meet-the-eligibility-criteria-and-will-comply-with-the-terms-and-conditions-set-forth-in-the-Restrictions-section-below.-Patients-with-questions-about-this-offer-should-call-1-866-441-3469.-Pharmacist:-When-you-apply-this-offer,-you-are-certifying-that-you-are-not-submitting-the-claim-for-this-prescription-for-reimbursement-underany-federal,-state,-or-other-governmental-programs.-Participation-in-this-offer-must-comply-with-all-applicable-laws-and-regulations-as-a-pharmacy-provider.-By-participating-in-this-offer,-you-are-certifying-that-you-will-comply-with-the-terms-and-conditions-set-forth-in-the-Restrictions-section-below.-Pharmacist-instructions-for-a-patient-paying-with-an-Eligible-Third-Party-Payer:-Submit-the-claim-to-the-primary-Third-Party-Payer-first,-then-submit-the-balance-due-to-Change-healthCare-as-a-Secondary-Payer-COB-[coordination-of-benefits]-with-patient-responsibility-amount-and-a-valid-Other-Coverage-Code,-(e.g.-8).-The-patient-is-responsible-for-the-first-$30-and-the-offer-pays-up-to-the-next-$60.-Reimbursement-will-be-received-from-Change-HealthCare.-The-patient-is-responsible-for-any-additional-amount-over-$90.-(Please-scroll-down-to-see-additional-Terms-and-Conditions.)" fill="#000000" font-family="GTWalsheim-Light, GT Walsheim" font-size="8" font-weight="300" line-spacing="10">
            <tspan x="25" y="503">Eligible patients will pay a minimum of $30 and receive up to a maximum of $60 off their co-payor out-of-pocket expense. Patient is responsible for the first </tspan>
            <tspan x="25" y="513">$30 and any prescription costs in excess of $90. This offer can be used for up to 30 capsules or 30 chewable tablets of Vyvanse (lisdexamfetamine </tspan>
            <tspan x="25" y="523">dimesylate). Offer is valid for up to 60 uses through offer expiry. A valid Prescriber ID# is required on each prescription.</tspan>
            <tspan x="25" y="538" font-family="GTWalsheim-Bold, GT Walsheim" font-weight="bold">Patient Instructions:</tspan>
            <tspan x="103.16" y="538"> In order to redeem this offer, you must have a valid prescription for Vyvanse. Follow the dosage instructions given by the prescribing </tspan>
            <tspan x="25" y="548">doctor. This offer may not be redeemed for cash. By using this offer, you are certifying that you meet the eligibility criteria and will comply with the terms and </tspan>
            <tspan x="25" y="558">conditions set forth in the Restrictions section below. Patients with questions about this offer should call 1-866-441-3469.</tspan>
            <tspan x="25" y="573" font-family="GTWalsheim-Bold, GT Walsheim" font-weight="bold">Pharmacist: </tspan>
            <tspan x="73.488" y="573">When you apply this offer, you are certifying that you are not submitting the claim for this prescription for reimbursement underany federal, </tspan>
            <tspan x="25" y="583">state, or other governmental programs. Participation in this offer must comply with all applicable laws and regulations as a pharmacy provider. By </tspan>
            <tspan x="25" y="593">participating in this offer, you are certifying that you will comply with the terms and conditions set forth in the Restrictions section below.</tspan>
            <tspan x="25" y="608" font-family="GTWalsheim-Bold, GT Walsheim" font-weight="bold">Pharmacist instructions for a patient paying with an Eligible Third Party Payer:</tspan>
            <tspan x="327.456" y="608"> Submit the claim to the primary Third Party Payer first, then submit the </tspan>
            <tspan x="25" y="618">balance due to Change healthCare as a Secondary Payer COB [coordination of benefits] with patient responsibility amount and a valid Other Coverage </tspan>
            <tspan x="25" y="628">Code, (e.g. 8). The patient is responsible for the first $30 and the offer pays up to the next $60. Reimbursement will be received from Change HealthCare. The </tspan>
            <tspan x="25" y="638">patient is responsible for any additional amount over $90.</tspan>
            <tspan x="25" y="653">(Please scroll down to see additional Terms and Conditions.)</tspan>
        </text>

        <text id="Who-should-not-take" fill="#000000" font-family="GTWalsheim-Medium, GT Walsheim" font-size="8" font-weight="400" line-spacing="10">
            <tspan x="25" y="32" text-decoration="underline">Who should not take Vyvanse?</tspan>
            <tspan x="25" y="51" font-family="GTWalsheim-Light, GT Walsheim" font-weight="300">Do not take Vyvanse if you or your child are:</tspan>
            <tspan x="25" y="70" font-family="GTWalsheim-Light, GT Walsheim" font-weight="300">- taking or have taken an anti-depression medicine called a monoamine oxidase inhibitor (MAOI) within the past 14 days.</tspan>
            <tspan x="25" y="80" font-family="GTWalsheim-Light, GT Walsheim" font-weight="300">- sensitive or allergic to, or had a reaction to other stimulant medicines.</tspan>
            <tspan x="25" y="90" font-family="GTWalsheim-Light, GT Walsheim" font-weight="300"></tspan>
            <tspan x="25" y="100" text-decoration="underline">Serious problems can occur while taking Vyvanse. Tell the doctor:</tspan>
        </text>

        <text id="if-you-or-your-child" fill="#000000" font-family="GTWalsheim-Light, GT Walsheim" font-size="8" font-weight="300" line-spacing="10">
            <tspan x="18" y="117">- if you or your child have heart problems, heart defects, high blood pressure, or a family history of these problems. Sudden death has occurred in </tspan>
            <tspan x="54" y="127">people with heart problems or defects taking stimulant medicines. Sudden death, stroke and heart attack have happened in adults taking stimulant </tspan>
            <tspan x="54" y="137">medicines. Your doctor should check you or your child carefully for heart problems before starting Vyvanse. Since increases in blood pressure and </tspan>
            <tspan x="54" y="147">heart rate may occur, the doctor should regularly check these during treatment. Call the doctor right away if you or your child have any signs of </tspan>
            <tspan x="54" y="157">heart problems such as chest pain, shortness of breath, or fainting while taking Vyvanse.</tspan>
            <tspan x="18" y="171">- if you or your child have mental (psychiatric) problems, or a family history of suicide, bipolar illness, or depression. New or worse behavior and </tspan>
            <tspan x="54" y="181">thought problems or new or worse bipolar illness may occur. New psychotic symptoms (such as seeing or hearing things that are not real, believing </tspan>
            <tspan x="54" y="191">things that are not true, being suspicious) or new manic symptoms may occur. Call the doctor right away if there are any new or worsening mental </tspan>
            <tspan x="54" y="201">symptoms or problems during treatment.</tspan>
            <tspan x="18" y="215">- if you or your child have circulation problems in fingers and toes (peripheral vasculopathy, including Raynauds phenomenon). Fingers or toes may </tspan>
            <tspan x="54" y="225">feel numb, cool, painful, sensitive to temperature and/or change color from pale, to blue, to red. Call the doctor right away if any signs of </tspan>
            <tspan x="54" y="235">unexplained wounds appear on fingers or toes while taking Vyvanse.</tspan>
            <tspan x="18" y="249">- if your child is having slowing of growth (height or weight). The doctor should check your childs height and weight often while on Vyvanse, and may </tspan>
            <tspan x="54" y="259">stop treatment if a problem is found.</tspan>
            <tspan x="18" y="273">- if you or your child have symptoms of serotonin syndrome: agitation, hallucinations, coma, or changes in mental status; problems controlling </tspan>
            <tspan x="54" y="283">movements or muscle twitching, stiffness, or tightness; fast heartbeat; sweating or fever; nausea, vomiting or diarrhea. Call your doctor or go to the </tspan>
            <tspan x="54" y="293">emergency room if symptoms occur. Serotonin syndrome may occur if Vyvanse is taken with certain medicines and may be life-threatening.</tspan>
            <tspan x="18" y="307">- if you or your child are pregnant or plan to become pregnant. It is not known if Vyvanse may harm your unborn baby.</tspan>
            <tspan x="18" y="321">- if you or your child are breastfeeding or plan to breastfeed. Do not breastfeed while taking Vyvanse. Talk to your doctor about the best way to feed </tspan>
            <tspan x="54" y="331">your baby if you take Vyvanse.</tspan>
        </text>
